import Wins from '../components/Wins/Wins';

const Account = () => {

  return (
    <React.Fragment>
      <Intro introType={'local'} label='Кабинет'/>
      <User />
      <Characters />
      <Wins />
    </React.Fragment>
  )

}

export default Account;
